import React, {Component} from "react";
import './form.css'
import styled from "styled-components";

const Formdata=styled.div`
 background-color: aquamarine;
height: auto;
width:400px;
margin: auto;
padding: 5px;
`;
const indianStates = [
"Andhra Pradesh", "Arunachal Pradesh", "Assam", "Bihar", "Chhattisgarh",
"Goa", "Gujarat", "Haryana", "Himachal Pradesh", "Jharkhand",
"Karnataka", "Kerala", "Madhya Pradesh", "Maharashtra", "Manipur",
"Meghalaya", "Mizoram", "Nagaland", "Odisha", "Punjab",
"Rajasthan", "Sikkim", "Tamil Nadu", "Telangana", "Tripura",
"Uttar Pradesh", "Uttarakhand", "West Bengal", "Andaman and Nicobar Islands",
"Chandigarh", "Dadra and Nagar Haveli and Daman and Diu", "Delhi",
"Jammu and Kashmir", "Ladakh", "Lakshadweep", "Puducherry"
];
const gender=['Mail','Femail','Other'];
class Form extends Component{
  constructor(props){
    super(props);
    this.props=props;
    this.state={
        name:'',
        lastname:'',
        fathername:'',
        mothername:'',
        email:'',
        birthdate:'',
        state:'',
        gender:'',

    }
  }
    
   onsubmitform=(e)=>{
      e.preventDefault();
      console.log(this.state)
    };
    
    onchengeform=(e)=>{
        this.setState({[e.target.name]:e.target.value})
    };
    render(){

    const buttons= {
    width:"40%",
    marginLeft:"10px"
    }

    
        return(
            <Formdata>
            <form onSubmit={onsubmitform}>
                <label htmlFor="name">FirstName</label>
                <input type="text" name="name" id="name" placeholder="Enter your name" onChange={onchengeform}/>
                <label htmlFor="lastname">LastName</label>
                <input type="text" name="lastname" id="lastname" placeholder="Enter last name" onChange={onchengeform}/>
                <label htmlFor="fathername">FatherName</label>
                <input type="text" name="fathername" id="fathername" placeholder="Enter father name" onChange={onchengeform}/>
                <label htmlFor="mothername">MotherName</label>
                <input type="text" name="mothername" id="mothername" placeholder="Enter mother name" onChange={onchengeform}/><br/>
                <label htmlFor="birthdate">Date of Birth</label><br/>
                <input type="date" name="birthdate" id="birthdate" onChange={onchengeform}/>
                <label htmlFor="email">Email</label>
                <input type="email" name="email" id="email" onChange={onchengeform}/>
                <label htmlFor="state">State</label><br/>
                <select style={{width:"90%"}} name="state" onChange={onchengeform}>
                <option>Select state</option>
                  {indianStates.map((g, index) => (
                    <option key={index} value={g}>{g}</option>
                     ))}
                </select>
                <label htmlFor="gender">Gender</label><br/>
                <select name="gender" style={{width:"90%"}}>
                    <option value=''>Select gender</option>
                    {gender.map((g,index)=>(
                    <option key={index} value={g}>{g}</option>
                    ))}
                </select>
                <label htmlFor="number">Contect Nomber :</label>
                <input type="number" name="number" id="number" onChange={onchengeform}/>

                <button type="reset" style={buttons}>Reset</button>
                <button type="submit" style={buttons}>Submit</button>
                
            </form>
            </Formdata>
        )
    }
}

export default Form;
